import React from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const Navbar = () => {
  const { user, logout } = useAuth();

  return (
    <nav className="bg-blue-600 p-4">
      <div className="flex items-center justify-between">
        <Link to="/" className="text-white text-xl font-bold">Lawberate</Link>
        <div className="flex items-center space-x-4">
          {user ? (
            <>
              <span className="text-white">{user.email}</span>
              <button onClick={logout} className="bg-red-500 text-white px-3 py-2 rounded">Logout</button>
            </>
          ) : (
            <>
              <Link to="/login" className="text-white px-3 py-2">Login</Link>
              <Link to="/register" className="bg-green-600 text-white px-3 py-2 rounded">Register</Link>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
